(1734, 325, '_general_0_tab_title', 'field_5f0c26b4b5f98'),
(1735, 325, 'general_0_tab_content', 'Todo comienza con una pasión. Entendemos que obtener excelentes resultados (y excelentes páginas web) no es un tema fácil. <br>Por este motivo, en DATA EG nos enfocamos en reclutar únicamente a personas que están realmente apasionadas por el objetivo de generar un impacto positivo en las vidas de nuestros clientes y sus negocios.'),
(1736, 325, '_general_0_tab_content', 'field_5f0c26cfb5f99'),
(1737, 325, 'general_0_tab_images', '138'),
(1738, 325, '_general_0_tab_images', 'field_5f0c26dfb5f9a'),
(1739, 325, 'general_1_tab_title', 'Innovación'),
(1740, 325, '_general_1_tab_title', 'field_5f0c26b4b5f98'),
(1741, 325, 'general_1_tab_content', 'Somos conscientes de que la sociedad enfrenta desafíos económicos, tecnológicos, sociales y culturales sin precedentes.<br>Por lo tanto, creemos que las nuevas innovaciones son la clave para convertir estos desafíos en oportunidades que logren marcar la diferencia y hacer crecer las marcas y negocios de nuestros clientes.'),
(1742, 325, '_general_1_tab_content', 'field_5f0c26cfb5f99'),
(1743, 325, 'general_1_tab_images', '145'),
(1744, 325, '_general_1_tab_images', 'field_5f0c26dfb5f9a'),
(1745, 325, 'general_2_tab_title', 'Resultados'),
(1746, 325, '_general_2_tab_title', 'field_5f0c26b4b5f98'),
(1747, 325, 'general_2_tab_content', 'Nos sumergimos y enfocamos por completo en el negocio y la industria de nuestros clientes, adquiriendo la misma visión para lograr los objetivos juntos.<br> Además, aprovechamos las mejores prácticas aprendidas a través de nuestra experiencia para garantizar resultados tangibles.'),
