(150, 1, '2020-07-09 12:29:08', '2020-07-09 12:29:08', '<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-red\",\"className\":\"sub_title\"} -->\n<h4 class=\"has-vivid-red-color has-text-color sub_title\"><strong>Páginas web</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"customTextColor\":\"#1e3e55\",\"className\":\"sec_title\"} -->\n<h2 class=\"has-text-color sec_title\" style=\"color:#1e3e55\"><strong>Diseño de páginas web atractivas y efectivas que enamorarán a tus clientes.</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Tu página web es el primer punto de contacto con muchos de tus clientes. Te juzgaran en funcionan de la imagen que transmitas. Para dar una primera buena impresión es muy importante tener un diseño web atractivo y bien acabado que transmita la mejor imagen de tu empresa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nuestros&nbsp;<strong>diseños de páginas web</strong>&nbsp;cautivan a los usuarios desde el primer momento. Diseñamos las páginas web con esta premisa en mente. Son páginas web claras, modernas, atractivas y efectivas que te ayudarán a dar la mejor imagen de tu empresa, conseguir nuevos clientes y fidelizar a los que ya tienes.</p>\n<!-- /wp:paragraph -->', 'DISEÑO WEB', '', 'publish', 'closed', 'closed', '', 'diseno-paginas-web', '', '', '2020-07-19 01:35:37', '2020-07-19 01:35:37', '', 0, 'http://www.dataeg-consulting.com.devel/?page_id=150', 0, 'page', '', 0),
