(283, 1, '2020-07-12 00:18:07', '2020-07-12 00:18:07', '<!-- wp:paragraph -->\n<p>La aplicación de mensajería instantánea sigue siendo líder por excelencia, por lo que sus creadores no dudan en agregarle novedades para todos sus usuarios.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>De acuerdo al portal Wabetainfo, la aplicación traerá una serie de nuevas opciones en la próxima actualización. Valga resaltar que estas novedades aún no están visibles, pero la aplicación está trabajando en las nuevas características para sorprendernos muy pronto.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Estas son:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>*Reproducir videos de YouTube:</strong>&nbsp;Con esta opción se podrá ver videos de YouTube directamente en WhatsApp, sin salir de la aplicación.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>*Anular mensajes:</strong>&nbsp;Será posible borrar un mensaje enviado a un chat de grupo o individual siempre y cuando no hayan pasado más de cinco minutos desde su envío.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>El mensaje o los mensajes que se anulen también desaparecerán de los chats de los contactos que lo reciban. Si en una conversación le aparece la frase: “Este mensaje fue anulado”, significa que la persona que lo envió lo anuló.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>*Notificación de cambo de número a todos tus contactos:</strong>&nbsp;Con esta función, cuando un usario cambie de número telefónico, se le avisará a todos los contactos para que guarden el contacto nuevo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>*Videollamadas:</strong>&nbsp;La opción permitirá crear una ‘ventana flotante’ con la videollamadas para seguir conversando en la aplicación.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>*Ubicación:</strong>&nbsp;Es una novedad que permite conocer la ubicación actual de todos los contactos. Según el medio, se podrá compartir durante varios minutos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Las funciones estarán disponibles tanto en Android como en Apple.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Además se conoció que la compañía trabaja en WhatsApp para empresas, una herramienta que permite utilizar la aplicación por parte de negocios y empresas para comunicarse con los usuarios.</p>\n<!-- /wp:paragraph -->', 'Las novedades que llegarán a WhatsApp', '', 'inherit', 'closed', 'closed', '', '281-revision-v1', '', '', '2020-07-12 00:18:07', '2020-07-12 00:18:07', '', 281, 'http://www.dataeg-consulting.com.devel/281-revision-v1/', 0, 'revision', '', 0),
