tual de todos los contactos. Según el medio, se podrá compartir durante varios minutos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Las funciones estarán disponibles tanto en Android como en Apple.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Además se conoció que la compañía trabaja en WhatsApp para empresas, una herramienta que permite utilizar la aplicación por parte de negocios y empresas para comunicarse con los usuarios.</p>\n<!-- /wp:paragraph -->', 'Las novedades que llegarán a WhatsApp', '', 'publish', 'open', 'open', '', 'las-novedades-que-llegaran-a-whatsapp', '', '', '2020-07-12 00:19:43', '2020-07-12 00:19:43', '', 0, 'http://www.dataeg-consulting.com.devel/?p=281', 0, 'post', '', 0),
