(280, 1, '2020-07-12 00:13:43', '2020-07-12 00:13:43', '<!-- wp:paragraph -->\n<p>Samsung presentó este miércoles en Nueva York su nuevo teléfono inteligente Galaxy S8, que incorpora un asistente virtual llamado Bixby, es resistente al agua y no tiene botón en la parte frontal.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Con este muy esperado modelo, el grupo surcoreano quiere dejar atrás el fracaso que supuso su Galaxy Note 7, cuya producción fue detenida en octubre del año pasado después de que varios dispositivos explotaran o se incendiaran.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>El presidente del grupo, DJ Koh, dijo durante el lanzamiento que tanto el Galaxy S8 como el S8+ marcan «una nueva era del diseño de teléfonos inteligentes».</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Los dos teléfonos, equipados con pantallas de 5,8 pulgadas (148,9 x 68,1 mm) y 6,2 pulgadas (159,5 x 73,4 mm), incluyen el asistente virtual mejorado de Samsung, Bixby, que entra en un terreno ya ocupado por Siri de Apple, Google Asistant y Alexa de Amazon.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Koh dijo que Bixby proporcionará a los usuarios «mucha más ayuda personalizada», usando comandos de voz para utilizar las aplicaciones y los servicios.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Bixby utiliza todas los datos del smartphone, entre ellos la geolocalización, para, por ejemplo, sugerir informaciones al usuario al salir de su casa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Aparte del asistente virtual, una de las principales novedades es que no tiene un botón en la parte delantera, como el que tiene su antecesor y también el iPhone.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Como suele ocurrir en cada nuevo lanzamiento, las capacidades del sistema operativo han sido mejoradas y su consumo de batería reducido.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pese a que fue el origen del fracaso del Galaxy Note 7, los directivos del grupo surcoreano presentes en el evento no mencionaron el punto de la batería, cuya seguridad y capacidades el mercado mira con lupa en este nuevo modelo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Además de Bixby, el Galaxy S8 y el S8 Plus están equipados con un sistema de reconocimiento de opciones múltiples: permite desbloquear el teléfono con un código secreto, conectando puntos de la pantalla y también con la huella digital.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Samsung desveló también un adaptador, llamado Samsung Dex, que permite trabajar en el smartphone desde un ordenador fijo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"right\"} -->\n<p class=\"has-text-align-right\"><a rel=\"noreferrer noopener\" href=\"http://www.eluniversal.com.co/tecnologia/samsung-presenta-el-nuevo-galaxy-s8-con-asistente-virtual-249659\" target=\"_blank\">Fuente : El Universal</a></p>\n<!-- /wp:paragraph -->', 'SAMSUNG PRESENTA EL NUEVO GALAXY S8 CON ASISTENTE VIRTUAL', '', 'inherit', 'closed', 'closed', '', '277-revision-v1', '', '', '2020-07-12 00:13:43', '2020-07-12 00:13:43', '', 277, 'http://www.dataeg-consulting.com.devel/277-revision-v1/', 0, 'revision', '', 0),
