(453, 1, '2020-07-17 00:47:01', '2020-07-17 00:47:01', '<div class=\"row\">\r\n\r\n   <div class=\"col-lg-6 col-sm-6\">\r\n     [text* nombre class:input-form  placeholder\"Tu Nombre\"]\r\n   </div>\r\n \r\n   <div class=\"col-lg-6 col-sm-6\">\r\n     [email* email class:input-form  placeholder\"Tu Email\"]\r\n   </div>  \r\n\r\n   <div class=\"col-lg-6 col-sm-6\">\r\n     [text* empresa class:input-form  placeholder\"Tu Empresa\"]\r\n   </div> \r\n\r\n   <div class=\"col-lg-6 col-sm-6\">\r\n     [text* asunto class:input-form  placeholder\"Asunto\"]\r\n   </div> \r\n\r\n   <div class=\"col-lg-12 col-sm-12\">\r\n     [select* dropdown class:input-form \"---: Selecciona un Departamento:---\" \"Comercial\" \"Factura\" \r\n    \"Hosting\" \"Reclamación\" \"Otro\"]\r\n   </div>\r\n \r\n   <div class=\"col-lg-12 col-sm-12\">\r\n    [textarea* mensaje class:input-form placeholder\"Mensaje\"] \r\n   </div>\r\n\r\n </div>\r\n\r\n[submit button class:common_btn class:red_bg  \"Enviar\"]\n1\nDATA EG CONSULTING \"[asunto]\"\nDATA EG CONSULTING <wordpress@dataeg-consulting.com.devel>\nwebamies@gmail.com\nDE : [nombre] <[email]>\r\nASUNTO : [asunto]\r\n\r\nDEPARTAMENTO :\r\n[dropdown]\r\n\r\nMENSAJE:\r\n[mensaje]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on DATA EG CONSULTING (http://www.dataeg-consulting.com.devel)\nReply-To: [email]\n\n\n\n\nDATA EG CONSULTING \"[your-subject]\"\nDATA EG CONSULTING <wordpress@dataeg-consulting.com.devel>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on DATA EG CONSULTING (http://www.dataeg-consulting.com.devel)\nReply-To: webamies@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact_consulting', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2020-07-17 21:00:58', '2020-07-17 21:00:58', '', 0, 'http://www.dataeg-consulting.com.devel/?post_type=wpcf7_contact_form&#038;p=453', 0, 'wpcf7_contact_form', '', 0),
